import React, { Fragment } from 'react';
import classes from './Header.module.css'
import video from '../../media/video.mp4'
const Home = () => {
  return (
    <Fragment>
      <div>
        <div className={classes['main-display']}>
        <video loop autoplay>
            <source src={video} type='video/mp4'/>
        </video>
        </div>
      </div>
    </Fragment>
  );
};

export default Home;
